Beware the Vatersay Boys

Arts Documentary hosted by Mairi Rodgers, published by BBC in 2011 - English narration


Information
------------------------------

Chapter 1. Beware the Vatersay Boys
The Vatersay Boys give viewers exclusive access to their lives over a six-month period as they tour Scotland, from their local ceilidh hall to their sold out Glasgow Barrowland gig.
Chapter 2. Balaich Bhatarsaigh @ Na Barrowlands
Scotland's number one party band, The Vatersay Boys, play their annual Glasgow Barrowland gig mixing their unique blend of ceilidh and traditional music.

